import React, { Component } from 'react'
import { Link } from 'react-router-dom'
import { Menu, Icon } from 'antd'

class Nav extends Component {
    state = {  }
    render() {
        return (

            <Menu onClick={this.handleClick} selectedKeys={[this.state.current]} mode="horizontal">
                <Menu.Item key="mail">
                    <Icon type="home" />
                    <Link to="/">Home</Link>
                </Menu.Item>
            </Menu>

        );
    }
}

export default Nav;
